import React, { useState } from 'react';
import { Button, Form } from 'react-bootstrap';

const Register = () => {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');

  const handleRegister = () => {
    // Implement your registration logic here
    // Send a request to the server to store user information in the MongoDB cluster
    // You can use fetch or axios to make an HTTP request to your server
    // For simplicity, let's assume registration is successful for any input
    console.log('Registration successful!');
  };

  return (
    <div className="container mt-5">
      <Form>
        <Form.Group controlId="formBasicUsername">
          <Form.Label>Username</Form.Label>
          <Form.Control type="text" placeholder="Enter username" onChange={(e) => setUsername(e.target.value)} />
        </Form.Group>

        <Form.Group controlId="formBasicPassword">
          <Form.Label>Password</Form.Label>
          <Form.Control type="password" placeholder="Password" onChange={(e) => setPassword(e.target.value)} />
        </Form.Group>
        <Link to="/">
          <p variant="success" className="ml-2">
            Back to login
          </p>
        </Link>
        <Button variant="success" onClick={handleRegister}>
          Register
        </Button>
      </Form>
    </div>
  );
};

export default Register;
